import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class="Title"><i>Color Detector</i></div>
      <form className="Input-Container" onSubmit="ReturnColors">
      <input type="text" id="search" name="search"></input>
      <input type="button" id="fname" name="fname"></input>
      </form>
    </div>
  );
}

export default App;
